INSERT INTO `notice` (`notice_id`, `created_at`, `updated_at`, `content`, `hits`, `impt_yn`, `title`, `school_id`) VALUES
	(1, '2023-02-13 02:28:30.309069', '2023-09-11 08:17:04.941317', '<p>2월 13일(월) 비포스쿨에서 안내받은 내용을 토대로 수강신청서를 작성하여</p><p>2월 15일(수) 10:00~11:00, 본관 1층 현관에 제출 바랍니다.&nbsp;</p><p>&nbsp;</p><p>월요일 비포스쿨에 참석하지 못한 학생은 아래 첨부파일을 인쇄하여&nbsp;</p><p>작성하시면 됩니다.&nbsp;</p><p>*미제출시, 선택 인원 부족 과목으로 편성됩니다.&nbsp;</p>', 2, 0, '2023학년도 신입생(1학년) 교육과정 편성을 위한 선택과목 수강신청 안내', 3),
	(2, '2023-02-17 03:07:16.752642', '2023-09-11 03:09:06.410755', '<p class="ql-align-justify">귀댁 자녀의 본교 배정을 진심으로 환영합니다.</p><p class="ql-align-justify">&nbsp;2023학년도 신입생 교복 착용은 하절기(5월말 하복착용)부터 하게됨을 알려드립니다.&nbsp;고1&nbsp;때 청소년 신체 성장이 많이 이루어지므로 입학 때 맞춘 동복을&nbsp;3년 동안 입기에는 학생들이 많이 불편해하고 있습니다. 1학년 때 입은 동복이&nbsp;2학년이 되면 몸에 맞지 않아 다시 교복을 구매하는 사례가 많았습니다.&nbsp;따라서 본교에서는 학교운영위원회 심의를 거쳐,&nbsp;교복 학교주관구매를 계획에 따라 추진하고 있습니다.</p><p class="ql-align-justify">&nbsp;신입생들은 하복을 구매 완료하게 되는&nbsp;5월 말까지는 단정한 사복 차림으로 등교하도록 지도해 주시기 바랍니다.&nbsp;추후 교복에 관한 사항은 다시 알려 드리겠습니다.&nbsp;감사합니다.</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;</p><p class="ql-align-center">2023. 2. 17.</p><p class="ql-align-center">청구고등학교 학생안전부</p><p><br></p>', 1, 0, '2023학년도 신입생 교복 착용 안내', 3),
	(3, '2023-02-28 03:11:59.571794', '2023-09-11 03:11:59.571794', '<p class="ql-align-justify">학부모님,&nbsp;안녕하십니까?&nbsp;대구교육과 학교교육 발전에 항상 관심을 가져주시고 협조해 주셔서 감사합니다.&nbsp;대구교육정보서비스(교육포털,&nbsp;행정기관 및 학교 누리집)&nbsp;통합고도화 사업의 일환으로 구축된<strong>「대구교육알리미」</strong>앱 서비스가 다음과 같이 정식 운영될 예정이오니,&nbsp;스마트폰을 통해 대구교육소식을 언제 어디서나 신속하게 제공받기를 원하시는&nbsp;학부모님께서는 아래 사항을 참고하여 적극 활용하여 주시기 바랍니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-center"><u>『대구교육알리미』&nbsp;앱 주요기능 및 활용 안내</u></p><p class="ql-align-justify"><strong>1.&nbsp;일자</strong>&nbsp;:&nbsp;<strong>2023. 2. 27.(월) ~</strong></p><p class="ql-align-justify"><strong>2.&nbsp;대상</strong>&nbsp;:&nbsp;학생,&nbsp;학부모,&nbsp;일반인</p><p class="ql-align-justify"><strong>3.&nbsp;절차</strong></p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;<strong>가.&nbsp;대구교육포털(에듀나비)&nbsp;회원가입</strong>(※&nbsp;이미 가입한 회원은 별도 가입 불필요)</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;대구교육포털(에듀나비)&nbsp;접속주소&nbsp;:&nbsp;<a href="https://www.edunavi.kr/" rel="noopener noreferrer" target="_blank" style="color: rgb(128, 0, 128);"><u>https://www.edunavi.kr</u></a></p><p>&nbsp;</p><p>* 많은 이용을 부탁드리며, 자세한 내용은 첨부된 파일을 참고해 주시기 바랍니다.</p>', 0, 0, '『대구교육알리미』 앱 주요기능 및 활용 안내', 3),
	(4, '2023-02-28 03:13:27.158626', '2023-09-11 03:18:16.564224', '<p>2023학년도 학생회 정.부회장 선거를 공고합니다.</p><p><br></p><p>1. 등록신청 : 2023년 3월 10일(금) ~ 3월 14일(화) 17시까지</p><p>2. 선거유세 : 2023년 3월 15일(수) ~ 3월 17일(금) 등교시간(~8:00까지)</p><p>3. 선 거 일 : 2023년 3월 17(금) 7교시&nbsp;</p><p><br></p><p>자세한 내용은 \'선거 공고\' 첨부파일을 참고하여, 학년 별 후보등록 기간에 해당 서류를 제출할 수 있도록 합니다.</p><p>선거 관련한 문의사항은 일과시간 중, 1층 교무실 황재호 선생님을&nbsp;찾아오거나,</p><p>053-235-5011로 전화하여 문의하시기 바랍니다.</p><p><br></p>', 1, 0, '2023학년도 학생회 정, 부회장 선거 공고', 3),
	(5, '2023-03-10 03:12:22.510674', '2023-09-11 03:12:22.510674', '<p>2023학년도 1,2,3학년 학반별 시간표 및 시정표를 안내드립니다.</p><p><br></p><p>2023학년도 등교 시정표 안내입니다.</p><p><br></p><p>등교 07:50-08:00 3학년</p><p>&nbsp;&nbsp;&nbsp;08:00-08:10 1, 2학년</p><p>1교시 08:30-09:20</p><p>2교시 09:30-10:20</p><p>3교시 10:30-11:20</p><p>4교시 11:30-12:20</p><p>중식&nbsp;12:20-13:20</p><p>5교시 13:20-14:10</p><p>6교시 14:20-15:10</p><p>7교시 15:20-16:10</p><p>종례,청소 16:10-16:30</p><p><br></p><p>3월 2일 등교 시 차질 없도록 등교하시기 바랍니다.</p><p><br></p><p>2023학년도 1,2,3학년 학반별 시간표 첨부파일을 참고하시기 바랍니다.</p>', 0, 0, '2023학년도 1,2,3학년 학반별 시간표 및 시정표 안내 공지', 3),
	(6, '2023-03-10 03:13:31.425804', '2023-09-11 03:18:54.021632', '<p>문의는 053-235-4918 주십시오 감사합니다.</p><p><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=09017bb60babff63ded2cd996f3e819b" alt="동구교육발전장학회_장학생 선발"></p>', 1, 0, '2023년도 (재)동구교육발전장학회 장학생 선발 안내', 3),
	(7, '2023-03-17 03:17:03.246485', '2023-09-11 03:19:34.375870', '<p><strong style="color: rgb(51, 51, 51);">청구고등학교 학생 여러분 안녕하십니까?</strong></p><p><strong>아래와 같이&nbsp;2023&nbsp;대구광역시 학생 과학 발명품 경진대회를 실시합니다.</strong></p><p><strong>관심있는 학생은 아래의 내용과 첨부파일을 모두 숙지하고,&nbsp;기한 내에 등록과 서류 제출을 하도록 바랍니다. 감사합니다.&nbsp;&nbsp;</strong></p><p><br></p><p>가.&nbsp;등록&nbsp;기한:&nbsp;<strong>2023. 3. 24.(금) 까지</strong>&nbsp;1층 교무실 김수진 선생님에게 등록 (작품명 정해서 올 것)</p><p>나.&nbsp;서류 제출 기한:&nbsp;<strong>2023. 4. 7. (금)까지</strong>&nbsp;1층 교무실 김수진 선생님에게&nbsp;<u style="color: rgb(0, 118, 200);">인쇄본 제출</u></p><p>　1)&nbsp;제출 서류:&nbsp;<u style="color: rgb(0, 85, 255);">[붙임2] 3부, [붙임3] 1부, [붙임4] 1부</u>&nbsp;(첨부파일 확인)</p><p> ** [붙임2]는 반드시 워드 프로세서로 작성할 것</p><p>다.&nbsp;유의 사항</p><p>　1)&nbsp;<strong style="color: rgb(102, 102, 102);">1교당&nbsp;5작품 이내</strong><span style="color: rgb(102, 102, 102);">&nbsp;출품</span></p><p>　2)&nbsp;<span style="color: rgb(102, 102, 102);">작품 개요만으로 심사하므로&nbsp;</span><strong style="color: rgb(102, 102, 102);">제작이 가능한 작품</strong><span style="color: rgb(102, 102, 102);">에 한하여 출품</span></p><p>　3)&nbsp;예비심사에서 선정된 작품은&nbsp;2023&nbsp;대구광역시학생과학발명품경진대회에 출품</p><p>　4)&nbsp;다음 사이트 등에서&nbsp;<strong>기 출품작 여부 확인 후 출품</strong></p><p><strong> </strong>가)&nbsp;특허정보넷 키프리스(http://www.kipris.or.kr)&nbsp;&nbsp;</p><p> 나)&nbsp;국립중앙과학관(https://www.science.go.kr)</p><p> 다)&nbsp;포털 사이트,&nbsp;유튜브 관련 검색 등</p><p>　5)&nbsp;<strong><u>반드시 연구윤리준수하여 출품바람.</u></strong></p><p>라.&nbsp;심사 기준:&nbsp;<u>창의성ㆍ탐구성(50),&nbsp;실용성(35),&nbsp;경제성(15)</u>으로 구분하여&nbsp;100점 만점으로 평가</p><p>마.&nbsp;심사 결과 발표:&nbsp;<strong>2023. 4. 24.(월)</strong>(예정)</p>', 1, 0, '2023 대구광역시 학생 과학 발명품 경진대회 고등학교 예비심사 안내', 3),
	(8, '2023-03-17 03:20:04.684466', '2023-09-11 03:20:04.684466', '<p>즐거운 독서로 더불어 성장하는 4월 화요일의 인문학 운영 계획을 다음과 같이 알리니, 희망하는 교직원, 학생, 학부모 분들은 참여해 주십시오.</p><p>&nbsp;</p><p><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=033b97934624f579461f7b1d0b58ec57"></p><p><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=3b6e1ac73358a9f6b509a107b75f3db6"></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;위 사진은 이해를 돕기 위한 사진입니다.&gt;</p>', 0, 0, '2023. 화요일의 인문학 4월 운영 안내', 3),
	(9, '2023-03-20 03:20:35.709826', '2023-09-12 07:23:27.581714', '<p><span style="color: rgb(51, 51, 51);">최근 페이스북 등&nbsp;SNS,&nbsp;알바 문자 등을 통해 청소년들을 유인하여 불법&nbsp;도박문자(이미지)&nbsp;스팸을&nbsp;전송하도록 하는 사례가 확인되고 있으며,&nbsp;이 과정에서 노출된&nbsp;휴대전화번호&nbsp;등의&nbsp;개인정보가 심각한 범죄에 이용될 수 있음을 인지하시고&nbsp;각별한 주의 당부드립니다.</span></p>', 3, 1, '\'문자알바\'로 청소년을 유혹하는 불법 스팸문자 전송 주의 안내문', 3),
	(10, '2023-03-21 03:21:22.861239', '2023-09-11 03:21:22.861239', '<p class="ql-align-justify">	1학년 학생들을 대상으로 하는&nbsp;2023년 청소년 인터넷·스마트폰 이용 습관 진단조사를 아래와 같이 실시합니다.&nbsp;반드시 조사 기간 중에 적극적으로 참여를 해서 본인의 인터넷 및 스마트 폰 이용 습관을 점검해 보기 바랍니다.</p><p class="ql-align-center">	&nbsp;</p><p class="ql-align-justify">	1.&nbsp;조사일: 2023년&nbsp;3월&nbsp;27일(월) ~ 4월&nbsp;7일(금)</p><p class="ql-align-justify">	2.&nbsp;조사 사이트</p><p class="ql-align-justify">	&nbsp;&nbsp;-&nbsp;스마트 폰에 있는 카메라에 아래 바코드를 대면 접속하려면&nbsp;‘여기를 누르세요’라는 메시지가 나오면 누르면 됨.</p><p class="ql-align-justify">	&nbsp;&nbsp;-&nbsp;옆에 있는 사이트 주소를 주소 입력창에 입력</p><p class="ql-align-justify">	&nbsp;&nbsp;-&nbsp;검색 사이트에서&nbsp;‘한국청소년상담복지개발원’을 검색</p><p>&nbsp;</p><p>&nbsp;</p><p>* 자세한 내용은 교실에 부착해 놓은 안내문 또는 첨부 파일을 참고하기를&nbsp;바랍니다.</p><p>&nbsp;</p>', 0, 0, '2023년 청소년 인터넷‧스마트폰 이용습관 진단조사 안내', 3),
	(11, '2023-03-21 03:22:01.791951', '2023-09-12 07:23:46.100718', '<p>	<strong>MS&nbsp;오피스&nbsp;365 ProPlus&nbsp;서비스」</strong>는&nbsp;MS&nbsp;클라우드 서비스로 교육청&nbsp;MS소프트웨어 사용 기간에 학생 및 교직원 개인(가정)의&nbsp;PC에 제공하는 서비스입니다.&nbsp;오피스 설치 프로그램을 다운로드 하여 개인PC(노트북),&nbsp;태블릿 등에 설치하여 사용할 수 있습니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>자세한 내용은 아래 주소를 클릭해 주십시오.</p><p>&nbsp;</p><p><a href="https://cg.riroschool.kr/board_msg.php?club=index&amp;action=view&amp;db=1901&amp;page=&amp;cate=&amp;t_year=&amp;sort=&amp;uid=1280&amp;inum=0&amp;key=&amp;key2=&amp;s1=&amp;s2=&amp;s3=" rel="noopener noreferrer" target="_blank" style="color: inherit;">https://cg.riroschool.kr/board_msg.php?club=index&amp;action=view&amp;db=1901&amp;page=&amp;cate=&amp;t_year=&amp;sort=&amp;uid=1280&amp;inum=0&amp;key=&amp;key2=&amp;s1=&amp;s2=&amp;s3=</a></p><p>&nbsp;</p><p>&nbsp;</p><p>위 사이트는 청구고등학교 학생, 학부모, 교직원만 이용할 수 있는 곳입니다.</p><p>&nbsp;</p>', 6, 1, 'MS 오피스 365 ProPlus 서비스 안내', 3),
	(12, '2023-03-22 03:22:39.658481', '2023-09-11 04:16:25.961232', '<p><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=9b2be6b238320ce6ed4b4e1255b356eb/img_7e3evd93a=24v00=45v99=8fvbf=5f2ev32c1v828d_v8031.jpg?1240^1754"></p><p>&nbsp;</p><p><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=aa94dd6796e8f4bbcd59225c6af950c6/img_c2b4v7484=e5vf1=4evd3=b8vfa=87b8vf21dv810e_v1658.png?567^255"></p>', 1, 0, '2023년 (재)삼성꿈장학재단 꿈장학 신청 안내', 3),
	(13, '2023-03-27 03:23:08.278628', '2023-09-11 03:23:08.278628', '<p class="ql-align-center"><strong>2023 소프트웨어 기초 아카데미 1기 운영 안내</strong></p><p><br></p><p>2023학년도&nbsp;소프트웨어 기초 아카데미&nbsp;1기를 다음과 같이 운영하니,&nbsp;관심 있는 학생들은&nbsp;신청바랍니다.</p><p>&nbsp;가.&nbsp;교육 운영 안내</p><p>&nbsp;&nbsp;&nbsp;1)&nbsp;교육 기간 및 시간:&nbsp;2023.&nbsp;4. 8.(토) ~ 4. 22.(토),&nbsp;매주 토요일, 3주간</p><p>&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;교육 시간: 13:00~17:00(총&nbsp;12시간)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;3)&nbsp;운영 프로그램:&nbsp;5개 과정</p><p class="ql-align-center"><strong>교육 과정명</strong></p><p class="ql-align-center"><strong>대상</strong></p><p class="ql-align-center"><strong>인원</strong></p><p class="ql-align-center"><strong>장소</strong></p><p>[초등]&nbsp;시선을 사로잡는 인포그래픽 만들기</p><p class="ql-align-center">초5~초6</p><p class="ql-align-center">20</p><p class="ql-align-center">옥상&nbsp;5층 로봇코딩실</p><p>[초등]&nbsp;나도 할 수 있어 유튜버</p><p class="ql-align-center">초5~초6</p><p class="ql-align-center">20</p><p class="ql-align-center">지하&nbsp;1층 공작실</p><p>[중등]&nbsp;프로그래밍 고수되기&nbsp;Python&nbsp;기초과정</p><p class="ql-align-center">중1~고2</p><p class="ql-align-center">20</p><p class="ql-align-center">5층 메이커랩&nbsp;2실</p><p>[중등]&nbsp;프로그래밍 고수되기&nbsp;C#&nbsp;기초과정</p><p class="ql-align-center">중1~고2</p><p class="ql-align-center">20</p><p class="ql-align-center">5층 메이커랩&nbsp;3실</p><p>[중등]&nbsp;프로그래밍 고수되기&nbsp;Java&nbsp;기초과정</p><p class="ql-align-center">중1~고2</p><p class="ql-align-center">20</p><p class="ql-align-center">5층 메이커랩&nbsp;4실</p><p>나.&nbsp;신청 안내</p><p>&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;<strong>신청 기간:&nbsp;2023. 3. 23.(목) 20:00 ~ 3. 29.(수) 20:00,&nbsp;온라인 선착순</strong></p><p>&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;신청 대상:&nbsp;초등학교&nbsp;5학년~고등학교&nbsp;2학년</p><p>&nbsp;&nbsp;&nbsp;&nbsp;3)&nbsp;신청 인원:&nbsp;과정별&nbsp;20명 선착순</p><p>&nbsp;&nbsp;&nbsp;&nbsp;4)&nbsp;신청 방법:&nbsp;대구교육포털 에듀나비 접속(www.edunavi.kr/)&nbsp;접속 후&nbsp;[통합예약]메뉴 신청</p><p>다.&nbsp;행정 사항 :&nbsp;<strong>학생생활기록부 등재 지원:&nbsp;과정별&nbsp;10시간 이상 출석 시 활동 내용 등재</strong></p><p>&nbsp;</p>', 0, 0, '2023 소프트웨어 기초 아카데미 1기 운영 안내', 3),
	(14, '2023-04-04 03:24:46.143998', '2023-09-11 03:24:46.143998', '<p><img src="data:image/png;base64,"></p>', 0, 0, '2023학년도 1학기 중간고사 일정 및 시간표 안내(2023. 5. 2(화)~2023. 5. 4.(목))', 3),
	(15, '2023-04-11 03:25:22.570566', '2023-09-12 07:23:34.584498', '<p class="ql-align-justify">안녕하십니까?&nbsp;본교는 학생들의 소질과 적성에 맞게 진로를 탐색하고 자신의 꿈과 끼를 키워 훌륭한 인재로 성장할 수 있도록 청구고 학생관리시스템&nbsp;(청구고 리로스쿨)을 운영하고 있습니다.&nbsp;이와 관련하여 안내 말씀 드리고자 합니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">청구고 학생관리시스템&nbsp;(청구고 리로스쿨)은 알리미(가정통신문,&nbsp;학교 및 진학 정보),&nbsp;평가(정기고사 시험범위,&nbsp;시간표 및 정답공개),&nbsp;학생들의 교과활동,&nbsp;포트폴리오,&nbsp;경시대회 및 진로체험활동 안내,&nbsp;성적분석(학교내신자료 및 학력평가자료),&nbsp;창체동아리,&nbsp;방과후/자기주도학습,&nbsp;진로진학 상담,&nbsp;상벌점 등을 제공하고 있습니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><span style="color: rgb(199, 82, 82);">2021학년도의 경우 아이디와 비밀번호는 학생,&nbsp;학부모님이 같이 공유하였으나</span></p><p class="ql-align-justify"><span style="color: rgb(199, 82, 82);">2022학년도부터는 학부모님께서 별도의&nbsp;ID와&nbsp;PW를 통해서 접속이 가능하십니다.</span></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><span style="color: rgb(199, 82, 82);">학부모님께서 가입을 희망하실 경우&nbsp;PC가 아닌 리로스쿨 모바일 앱을 통해서만 가입이 가능합니다.</span></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><span style="color: rgb(199, 82, 82);">ID의 경우&nbsp;E-mail&nbsp;주소 양식으로 생성하셔야 하며</span></p><p class="ql-align-justify"><span style="color: rgb(199, 82, 82);">세부 절차는 다음과 같습니다.</span></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><span style="color: rgb(199, 82, 82);">[&nbsp;앱 로그인 화면에서&nbsp;‘&nbsp;학부모&nbsp;’&nbsp;선택&nbsp;→&nbsp;‘학부모 회원가입’&nbsp;클릭&nbsp;→&nbsp;약관 동의</span></p><p class="ql-align-justify"><span style="color: rgb(199, 82, 82);">→&nbsp;휴대전화 번호 인증&nbsp;→&nbsp;ID/PW&nbsp;설정&nbsp;→&nbsp;아버지/&nbsp;어머니 선택&nbsp;→</span></p><p class="ql-align-justify"><span style="color: rgb(199, 82, 82);">학교명 확인/&nbsp;자녀 이름 입력&nbsp;→&nbsp;회원가입&nbsp;]</span></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><span style="color: rgb(199, 82, 82);">(부,&nbsp;모 각자 로그인이 가능하며,&nbsp;부,&nbsp;모 핸드폰번호가 학교에 잘못 입력되어 있으면 로그인이 되지 않습니다.)&nbsp;</span>&nbsp;&nbsp;</p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><strong style="color: rgb(0, 118, 200);">상세한 가입 절차는 첨부 파일을 참고하시면 감사하겠습니다</strong>.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">자녀의 아이디를 통해 접속하신 후</p><p class="ql-align-justify">리로스쿨&nbsp;–&nbsp;가정통신문&nbsp;–리로스쿨 사용 안내(학생,&nbsp;학부모용)&nbsp;파일을 참고하시면 보다 쉽게 접근하실 수 있습니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">가내에 두루 행복이 가정하시고</p><p class="ql-align-justify">한 해 자녀들의 교육을 보조할 수 있는 유용한 앱이므로 많은 관심 부탁드리겠습니다.</p>', 11, 1, '진로진학 이력관리 시스템(리로스쿨) - 가입 안내', 3),
	(16, '2023-04-19 03:25:46.741109', '2023-09-11 04:18:51.509266', '<p class="ql-align-justify">「제13회 대구광역시 고등학생 토론한마당」개최 안내</p><p class="ql-align-justify"><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=d0cf14b31d06b5cb89a8257b96975dc9/img_f34fvbe57=01vd2=4bv99=bev0a=8fedvb9b6v1075_v2399.jpg?891^1260" alt="대구광역시선거관리위원회 홍보과_제13회 고등학생 토론한마당 웹포스터(2023)"></p><p class="ql-align-justify">대구광역시선거관리위원회에서는 대구지역 고등학생을 대상으로 토론회를 개최한다고 합니다.&nbsp;관심있는 학생들은 신청해서 참가하기 바랍니다.</p><p class="ql-align-justify">&nbsp;</p><p>※&nbsp;대구시선관위 홈페이지 토론한마당 참가신청 안내 게시물 링크&nbsp;URL(알림-공지사항) https://su.nec.go.kr/dg/bbs/B0000265/view.do?nttId=212130&amp;menuNo=400007&amp;category1=dg&amp;category2=&amp;deleteCd=0&amp;pageIndex=1</p>', 1, 0, '「제13회 대구광역시 고등학생 토론한마당」개최 안내', 3),
	(17, '2023-04-19 03:26:07.124234', '2023-09-11 03:26:07.124234', '<p>운영 개요</p><p>교육 과정:&nbsp;총&nbsp;5개 과정<strong>(대면 수업)</strong></p><p class="ql-align-center">교육 과정명</p><p class="ql-align-center">대상</p><p class="ql-align-center">인원</p><p class="ql-align-center">교육 장소</p><p><strong>시선을 사로잡는 인포그래픽 만들기</strong></p><p class="ql-align-center">초5~초6</p><p class="ql-align-center">20</p><p class="ql-align-center">대구창의융합교육원</p><p class="ql-align-center">메이커랩&nbsp;1실</p><p><strong>드론 프로그래밍</strong></p><p class="ql-align-center">초5~초6</p><p class="ql-align-center">20</p><p class="ql-align-center">대구창의융합교육원</p><p class="ql-align-center">미디어실</p><p><strong>마이크로비트로&nbsp;Iot&nbsp;활용하기</strong></p><p class="ql-align-center"><strong>중1~중3</strong></p><p class="ql-align-center">20</p><p class="ql-align-center">대구창의융합교육원</p><p class="ql-align-center">메이커랩&nbsp;2실</p><p><strong>3D&nbsp;공간 디자인하기(Sketchup)</strong></p><p class="ql-align-center">중1~고2</p><p class="ql-align-center">20</p><p class="ql-align-center">대구창의융합교육원</p><p class="ql-align-center">메이커랩&nbsp;3실</p><p><strong>프로그래밍 고수되기&nbsp;Python&nbsp;기초과정</strong></p><p class="ql-align-center">중1~고2</p><p class="ql-align-center">20</p><p class="ql-align-center">대구창의융합교육원</p><p class="ql-align-center">메이커랩&nbsp;4실</p><p><strong>*&nbsp;각 과정별&nbsp;10명 미만 신청은 과정에 따라 과정 운영이 취소될 수 있음</strong></p><p>&nbsp;</p><p>교육 대상:&nbsp;과정별 초5 ~&nbsp;고2&nbsp;신청 학생,&nbsp;선착순 신청&nbsp;20명</p><p>교육 시기</p><p>◦&nbsp;교육일자:&nbsp;2023. 5. 6.(토), 5. 13.(토), 5. 20.(토)</p><p>◦&nbsp;교육시간: 13:00 ~ 17:00(매주 토요일&nbsp;4시간)</p><p>◦&nbsp;총 교육시간:&nbsp;교육 과정별&nbsp;12시간<strong>(10시간 이상 수강 시 학교생활기록부 등재)</strong></p><p>교육 안내 및 신청 방법</p><p>교육 안내</p><p>◦&nbsp;관련 교재는 현장 제교육비:&nbsp;무료</p><p><strong>신청 방법</strong></p><p><strong>신청 기간</strong></p><p><strong>2023. 4. 19.(수) 20:00 ~ 4. 25.(화) 20:00,&nbsp;선착순 신청</strong></p><p>방법</p><p>&nbsp;</p><p>대구창의융합교육원(<a href="http://www.dge.go.kr/dicce/" rel="noopener noreferrer" target="_blank" style="color: rgb(128, 0, 128);">http://www.dge.go.kr/dicce/</a>)&nbsp;홈페이지&nbsp;→&nbsp;통합예약시스템&nbsp;→ →&nbsp;“대구창의융합교육원”&nbsp;기관 선택&nbsp;→&nbsp;검색 창&nbsp;“아카데미”&nbsp;검색&nbsp;→&nbsp;학년 및 프로그램 확인 후 희망과정 선택</p><p>학생 또는 학부모가 희망 교육 과정 신청,&nbsp;<strong>온라인 신청 선착순 마감</strong></p><p><strong>소속학교,&nbsp;연락처,&nbsp;학반 등 정확한 정보 필수 입력</strong></p><p>문의:&nbsp;대구창의융합교육원 융합교육부&nbsp;053-231-1194</p><p><strong>※&nbsp;개인 사정으로 참여하지 못할 경우에는 개강&nbsp;3일 전까지 담당자에게 반드시 사전 연락바람,&nbsp;</strong><strong style="color: rgb(255, 0, 0);">사전 연락 없이</strong>&nbsp;<strong>불참할 경우</strong>&nbsp;<strong><u>2023학년도&nbsp;SW&nbsp;교육 프로그램 신청 시 제외될 수 있음</u></strong></p>', 0, 0, '대구창의융합교육원 소프트웨어 기초 아카데미 2기 운영 안내', 3),
	(18, '2023-04-28 03:26:42.927323', '2023-09-11 06:07:02.923915', '<p class="ql-align-justify">1.&nbsp;한국과학기술정보연구원(KISTI)은 과학기술정보통신부 산하 정부출연연구기관으로 국가슈퍼컴퓨팅,&nbsp;국가과학기술&nbsp;&nbsp;&nbsp;데이터,&nbsp;과학기술 정보 유통 및 분석을 수행하는 연구원입니다.</p><p class="ql-align-justify">2.&nbsp;울산과학기술원(UNIST)과 공동으로 첨단과학기술개발을 주도하는 슈퍼컴퓨팅우수인재 발굴 및 양성을 위한&nbsp;[제7회 슈퍼컴퓨팅 청소년캠프]를 다음과 같이 개최하고자 하오니 관심있는 학생들은 참가하여 주시기 바랍니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-center">-&nbsp;다 음&nbsp;-</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;가.&nbsp;행 사 명&nbsp;:&nbsp;제7회 슈퍼컴퓨팅 청소년캠프</p><p class="ql-align-justify">&nbsp;&nbsp;나.&nbsp;일 시&nbsp;: 2023년&nbsp;7월&nbsp;17일(월) ~ 2023년&nbsp;7월&nbsp;21일(금) 4박&nbsp;5일</p><p class="ql-align-justify">&nbsp;&nbsp;다.&nbsp;장 소&nbsp;:&nbsp;울산과학기술원(UNIST)</p><p class="ql-align-justify">&nbsp;&nbsp;라.&nbsp;주최/주관&nbsp;:&nbsp;한국과학기술정보연구원(KISTI),&nbsp;울산과학기술원(UNIST)</p><p class="ql-align-justify">&nbsp;&nbsp;<strong>마.&nbsp;신청기간&nbsp;: 2023년&nbsp;4월&nbsp;24일(월) ~ 2023년&nbsp;5월&nbsp;24일(수)</strong></p><p class="ql-align-justify">&nbsp;&nbsp;바.&nbsp;참가대상&nbsp;:&nbsp;전국 고등학교 재학생</p><p class="ql-align-justify">&nbsp;&nbsp;사.&nbsp;참가인원&nbsp;: 30개팀(각 학교별 최대&nbsp;2팀까지 신청 가능)</p><p class="ql-align-justify">&nbsp;&nbsp;아.&nbsp;행사내용&nbsp;:&nbsp;슈퍼컴퓨터 구축,&nbsp;활용 교육 및 실습,&nbsp;병렬 컴퓨팅,&nbsp;인공지능 등</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(붙임문서 참조)</p><p>&nbsp;</p>', 1, 0, '제7회 슈퍼컴퓨팅 청소년캠프 안내', 3),
	(19, '2023-05-02 03:27:11.617226', '2023-09-11 03:27:11.617226', '<p class="ql-align-center"><strong>아동·청소년 디지털 잊힐 권리</strong></p><p class="ql-align-justify"><br></p><p class="ql-align-justify">개인정보보호위원회에서는 어렸을 때 온라인에 올린 게시물을 삭제하고 싶은 아동·&nbsp;청소년이 해당 게시물을 삭제 또는 가림처리(접근배제)&nbsp;할 수 있도록 지원하는‘아동·청소년 디지털 잊힐권리 시범사업’을 시행하고 있다고 합니다.</p><p class="ql-align-justify">SNS 등에 본인이 작성한 글 중 삭제하고 싶은 글이 있으면 참고해서 신청하길 바랍니다.</p><p class="ql-align-justify"><a href="https://www.privacy.go.kr/front/contents/cntntsView.do?contsNo=260#none" rel="noopener noreferrer" target="_blank" style="color: inherit;"><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=b66d7774c5788bcc68e63308b0642f77/img_7d79v0229=94v65=45va4=82v6a=d189v939fv01aa_v873.jpg?2480^3508" alt="대구광역시교육청 회계정보과_붙임1_잊힐권리 포스터"></a></p><p><br></p>', 0, 0, '아동·청소년 디지털 잊힐 권리 사업 안내', 3),
	(20, '2023-05-04 03:27:52.531168', '2023-09-11 03:27:52.531168', '<p>https://cg.dge.hs.kr/cgh/na/ntt/selectNttInfo.do?mi=10069416&amp;bbsId=10069416&amp;nttSn=40108112</p><p><br></p><p>위 링크로 접속하여 확인하시기 바랍니다.</p>', 0, 0, '2023학년도 1학기 중간고사 정답 안내', 3),
	(21, '2023-05-10 03:28:34.264873', '2023-09-11 03:28:34.264873', '<p class="ql-align-justify">우리원과 대구광역시를 비롯한 유관기관에서 공동으로 주최하는&nbsp;「제5회 대구 빅데이터 분석 경진대회」가 다음과 같이 개최되니,&nbsp;관심있는 학생들이 참가하여 주시기 바랍니다.</p><p class="ql-align-justify">1.&nbsp;대회 개요</p><p class="ql-align-justify">&nbsp;&nbsp;가.&nbsp;대회명:&nbsp;<strong>제5회 대구 빅데이터 분석 경진대회(데이터 시각화 분야)</strong></p><p class="ql-align-justify">&nbsp;&nbsp;나.&nbsp;참가접수 기간:&nbsp;<strong>2023.5.4.(목) ~ 5.31.(수), 17:00까지</strong></p><p class="ql-align-justify">&nbsp;&nbsp;다.&nbsp;참가대상:&nbsp;<strong>중·고등학생(지도교사 포함&nbsp;2인 또는&nbsp;4인 이내 팀)</strong></p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;데이터 분석 및 활용 분야는 교원 참여 가능</p><p class="ql-align-justify">&nbsp;&nbsp;라.&nbsp;주제: ‘살기좋은 대구’만들기를 위한 자유 주제</p><p class="ql-align-justify">&nbsp;&nbsp;마.&nbsp;접수방법:&nbsp;이메일 접수(bigdata01@dip.or.kr)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;<strong><u>제출마감일&nbsp;17시까지 도착분</u></strong>에 한해 유효함</p><p>&nbsp;&nbsp;바.&nbsp;세부 내용은&nbsp;[붙임1]&nbsp;제5회 대구 빅데이터 분석 경진대회 참가자 모집 공고문 참조</p><p>2.&nbsp;문의:&nbsp;(재)대구디지털혁신진흥원 빅데이터활용센터 경진대회 담당자(☎&nbsp;053-951-8977,&nbsp;<strong>E-mail:</strong>&nbsp;bd1jun@dip.or.kr)</p><p>3.&nbsp;기타:&nbsp;홈페이지 탑재(우리원에서 홈페이지 팝업으로 포스터 일괄 탑재 예정)</p>', 0, 0, '제5회 대구 빅데이터 분석 경진대회(데이터 시각화 분야) 참가 안내', 3),
	(22, '2023-05-12 03:29:23.834267', '2023-09-11 03:29:23.834267', '<p class="ql-align-justify">	교육부와 한국교육방송공사가&nbsp;<strong>기초생활수급 대상 가정의 고교생</strong>에게<strong>&nbsp;EBS&nbsp;고교교재를 무상 제공</strong>하고 있으니,&nbsp;해당 학생이 신청하기를 바랍니다.</p><p class="ql-align-justify">	&nbsp;&nbsp;가.<strong>&nbsp;신청 기간: 2023. 5.11.(목) ~ 6.27.(화), (2학기&nbsp;1차)</strong></p><p class="ql-align-justify">	&nbsp;&nbsp;나.&nbsp;대상:&nbsp;<strong>국민 기초생활 수급권자(생계·의료·주거·교육급여)&nbsp;가정의 청소년</strong></p><p class="ql-align-justify">	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(고교생,&nbsp;검정고시생,&nbsp;홈스쿨링 대상자 포함)</p><p class="ql-align-justify">	&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;<strong>차상위 계층은 해당되지 않음.</strong></p><p class="ql-align-justify">	&nbsp;&nbsp;다.&nbsp;<strong>신청 방법:&nbsp;EBSi&nbsp;사이트 접속</strong>(<a href="http://https//www.ebsi.co.kr/ebs/pot/poty/grtsBookMain.ebs" rel="noopener noreferrer" target="_blank" style="color: rgb(128, 0, 128);"><u>https://www.ebsi.co.kr/ebs/pot/poty/grtsBookMain.ebs</u></a>)</p><p class="ql-align-justify">	&nbsp;&nbsp;</p><p class="ql-align-center"><a href="http://www.ebsi.co.kr/" rel="noopener noreferrer" target="_blank" style="color: rgb(0, 0, 255);"><u>www.ebsi.co.kr</u></a><u style="color: rgb(128, 0, 128);">&nbsp;</u>교재메뉴 왼쪽 하단&gt;무상교재</p><p class="ql-align-center">신청하기</p><p class="ql-align-justify">→</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-center">이름,</p><p class="ql-align-center">주민등록번호</p><p class="ql-align-center">입력</p><p class="ql-align-justify">→</p><p class="ql-align-center">대상자 확인 후 본인 확인</p><p class="ql-align-justify">→</p><p class="ql-align-center">신청학년 및 배송지 입력</p><p class="ql-align-justify">→</p><p class="ql-align-center">교재 발행 후 개별 주소지로 발</p><p class="ql-align-center">송</p><p class="ql-align-justify">		&nbsp;&nbsp;&nbsp;	<strong>※&nbsp;</strong>	<strong>학생이 개별적으로 위 경로를 따라 사이트에서 직접 신청</strong></p><p class="ql-align-justify">	</p><p class="ql-align-justify">	&nbsp;&nbsp;라.&nbsp;지원 교재:&nbsp;고1(3책),&nbsp;고2(4책),&nbsp;고3(12책),&nbsp;세부내용은&nbsp;&lt;붙임1&gt;&nbsp;참조<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></p><p class="ql-align-justify">	</p><p class="ql-align-justify">	<strong>※&nbsp;</strong>배너 접속 링크:&nbsp;<u style="color: rgb(128, 0, 128);">https://www.ebsi.co.kr/ebs/pot/poty/grtsBookMain.ebs</u></p><p class="ql-align-justify">	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-<strong>&nbsp;대상:&nbsp;고등학교,&nbsp;특수학교,&nbsp;각종학교,&nbsp;학력인정학교</strong></p><p class="ql-align-justify">	&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-<strong>&nbsp;기간: 2023. 5.11.(목)&nbsp;∼&nbsp;6.27.(화)</strong></p><p><br></p><p><br></p>', 0, 0, '기초생활수급 대상 가정의 고교생에게 EBS 고교교재를 무상 제공 안내', 3),
	(23, '2023-05-15 03:29:44.742699', '2023-09-11 03:29:44.742699', '<p>2023학년도 흡연 실태조사를 위한 설문을 리로스쿨을 통해 실시하고자 합니다.</p><p>전교생이 설문에 참여 할 수 있도록 합니다.</p><p>1) 설문 참여 기간: 2023. 5. 16.(화) ~ 5. 25.(목)</p><p>2) 설문참여방법: 리로스쿨 - 알림신청 - 설문조사 - 2023학년도 흡연 실태조사 설문</p>', 0, 0, '2023학년도 전교생 흡연 실태조사 설문 실시', 3),
	(24, '2023-05-18 03:30:17.101066', '2023-09-11 03:30:17.101066', '<p>매일신문은&nbsp;5월 청소년의 달을 맞아 경제적 곤란을 겪고 있는 저소득층 청소년에게 희망을 심어주고 학업 환경을 개선하는데 도움을 주고자&nbsp;2010년부터 매년 청소년 장학금 지원 사업을 진행하고 있습니다.&nbsp;지역의 청소년들에게 힘을 실어주기 위한 장학금 사업을 진행한다고 합니다.</p><p>&nbsp;</p><p class="ql-align-center">-&nbsp;아 래&nbsp;-</p><p class="ql-align-center">&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;가.&nbsp;사 업 명&nbsp;:&nbsp;제14회 청소년 장학생 선발</p><p>&nbsp;&nbsp;&nbsp;&nbsp;나.&nbsp;행사내용</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;대상&nbsp;:&nbsp;대구·경북지역 저소득층 청소년(기초생활수급자 및 한부모가족 자녀 등)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;선발인원&nbsp;:&nbsp;총&nbsp;30명(초등학생&nbsp;10명,&nbsp;중학생&nbsp;10명,&nbsp;고등학생&nbsp;10명)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3)&nbsp;장학금 지급액&nbsp;:&nbsp;총&nbsp;3,000만원(1인 각&nbsp;100만원)</p><p>&nbsp;</p><p><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=b45b14ecf81256ee5e670f0757d131d2/img_dd78vdb86=51vf0=44v6b=9av8b=98a8v0c25v5232_v4143.jpg?1241^1754" alt="매일신문사_제14회 장학생선발 안내"></p>', 0, 0, '제14회 청소년 장학생 선발', 3),
	(25, '2023-05-19 03:32:38.033394', '2023-09-11 03:32:38.033394', '<p class="ql-align-justify">국가정보원에서&nbsp;‘<strong>2023&nbsp;사이버공격방어대회</strong>’를 아래와 같이 개최할 예정이라 하니 관심있는 학생들은 참여해 보세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;가.&nbsp;대회신청: 2023. 6. 5.(월)&nbsp;까지,&nbsp;홈페이지(https://cce.cstec.kr)를 통해 신청</p><p class="ql-align-justify">&nbsp;&nbsp;나.&nbsp;예선: 2023. 6. 10.(토),&nbsp;온라인 방식</p><p class="ql-align-justify">&nbsp;&nbsp;다.&nbsp;본선: 2023. 7. 12.(수),&nbsp;롯데호텔 서울(소공동)</p><p>&nbsp;</p>', 0, 0, '2023 사이버 공격 방어 대회', 3),
	(26, '2023-05-19 03:30:50.050380', '2023-09-11 03:30:50.050380', '<p><span style="color: rgb(51, 51, 51);"><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=55bd9591e0cbb2c1747cb9b66d022993/img_8acdv1e10=85vde=41vbe=bcvaf=8e4fve754vd78b_v6821.jpeg?1440^810" alt="나이스 대국민서비스 일시 중단 안내"></span></p>', 0, 0, '나이스 대국민 서비스 일시 중단 안내', 3),
	(27, '2023-05-19 03:31:08.377418', '2023-09-11 03:31:08.377418', '<p class="ql-align-center"><strong>폭염대비 국민행동요령</strong></p><p class="ql-align-justify"><strong>&nbsp;</strong></p><p class="ql-align-justify"><strong style="color: rgb(0, 0, 255);">무더울 땐 이렇게 준비하세요&nbsp;!</strong></p><p class="ql-align-justify"><strong>【사전 준비사항은】</strong></p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;라디오나&nbsp;TV의 무더위관련 기상상황에 매일 주목하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;정전에 대비 손전등,&nbsp;비상 식음료,&nbsp;부채,&nbsp;휴대용 라디오 등을 미리 확인해 두세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;집에서 가까운 병원의 연락처를 확인하고 본인과 가족의 열사병 등 증상을 체크하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;단수에 대비하여 생수를 준비하고 생활용수는 욕조에 미리 받아두세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;냉방기기 사용 시는 실내․외 온도차를&nbsp;5℃내외로 유지하여 냉방병을 예방하세요.(<strong><u>건강 실내 냉방온도는&nbsp;26℃～28℃가 적당)</u></strong></p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;변압기의 점검으로 과부하에 사전대비하세요.(특히,&nbsp;오래된 공동주택은 각별히 주의)</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;창문에 커튼이나 천 등을 이용,&nbsp;집안으로 들어오는 직사광선을 최대한 차단하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;장거리 차량 운행계획이 있다면 도로의 변형 등으로 교통사고 등이 발생할 수 있으므로 신중히 검토하세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong style="color: rgb(255, 0, 0);">■&nbsp;폭염주의보 발령시</strong></p><p class="ql-align-justify"><strong>【일반 가정 등에서는】</strong></p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;야외활동을 자제하세요.(부득이 외출을 할 경우 창이 넓은 모자착용 및 가벼운 옷차림을 하고 꼭 물병 휴대)</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;물을 많이 마시되 너무 달거나 카페인이 들어간 음료,&nbsp;주류 등은 마시지 마세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;냉방이 되지 않는 실내의 경우 햇볕이 실내에 들어오지 않도록 하고 맞바람이 불도록 환기를 하고 선풍기를 켜세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;창문이 닫힌 자동차 안에 노약자나 어린이를 홀로 남겨두지 마세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;거동이 불편한 고령,&nbsp;독거노인,&nbsp;신체허약자,&nbsp;환자 등은 외출을 삼가고 이들을 남겨두고 장시간 외출 시는 친인척․이웃 등에 보호를 의뢰하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;탈수 등의 이유로 소금 등을 섭취할 때에는 의사의 조언을 들으세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;현기증,&nbsp;메스꺼움,&nbsp;두통,&nbsp;근육경련 등 열사병 초기증세가 보일 경우에는 시원한 장소로 이동하여 몇 분간 휴식을 취한 후 시원한 음료를 천천히 마시세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong>【직장에서는】</strong></p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;야외행사 및 친목도모를 위한 스포츠경기 등 각종 외부행사를 자제하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;점심시간 등을 이용&nbsp;10분～15분 정도의 낮잠을 청하여 개인건강을 유지하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;직원들이 자유 복장으로 출근 및 근무하도록 근무환경을 개선하세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong>【학교에서는】</strong></p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;초등․중․고등학교에서는 수업단축을 검토하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;운동장에서의 체육활동 및 소풍 등 각종 야외활동을 자제하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;학교 급식시 식중독 사고가 발생하지 않도록 주의하세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong style="color: rgb(255, 0, 0);">■&nbsp;폭염경보 발령시</strong></p><p class="ql-align-justify"><strong>【일반 가정 등에서는】</strong></p><p class="ql-align-justify">&nbsp;&nbsp;- 12시～오후&nbsp;5시 사이에는 야외활동을 금지하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;준비 없이 물에 들어가거나 갑자기 찬물로 사워를 하지 마세요.(심장마비 위험)</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;선풍기를 창문 쪽으로 돌려 환기를 유도하세요.(선풍기를 장시간 연속 사용은 자제)</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;늦은 시간 과다한 운동은 숙면을 방해하므로 자제하고 정신적 긴장감을 줄 수 있는 드라마 시청,&nbsp;컴퓨터 게임 등을 삼가세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;넉넉하고 가벼운 옷을 입어 자외선을 방지하고 노출부위는 썬크림 등 자외선 차단제를 발라 피부를 보호하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;어린아이를 데리고 야외에 나갈 경우에는 두꺼운 담요나 옷으로 감싸지 마세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;거동이 불편한 고령,&nbsp;독거노인,&nbsp;신체허약자,&nbsp;환자 등은 외출을 금지시키고 가족 및 친척․이웃이 수시로 상태를 점검하세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong>【직장에서는】</strong></p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;각종 야외행사를 취소하고 활동을 금지하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;직원을 대상으로 낮잠시간을 한시적으로 검토하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;기온이 높은 시간대를 피해 탄력시간근무제를 검토하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;정상적인 몸 상태가 아닌 직원에 대하여는 강제휴가 조치하세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong>【학교에서는】</strong></p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;특히,&nbsp;초등․중학교에서는 휴교조치를 검토하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;운동장에서의 체육활동 및 소풍 등 각종 야외활동을 금지하세요.</p><p class="ql-align-justify">&nbsp;&nbsp;-&nbsp;학교 급식 시 식중독 사고가 발생하지 않도록 재점검하세요.</p><p><br></p>', 0, 0, '폭염대비 국민행동요령', 3),
	(28, '2023-05-23 03:33:14.006438', '2023-09-11 03:33:15.313525', '<p class="ql-align-center"><strong>고등학교 1·2학년 진로·진학 설계는 이렇게 준비하자!</strong></p><p><strong>1. 설명회 개요</strong></p><p><strong>&nbsp;&nbsp;가. 행사명&nbsp;</strong>:&nbsp;2023&nbsp;고&nbsp;1&nbsp;·2&nbsp;학년 학생&nbsp;·학부&nbsp;모 대상 진로&nbsp;·진학 설명회</p><p><strong>&nbsp;&nbsp;나.&nbsp;일시</strong>: 2023. 6. 10.(토) 14:00 ~ 17:00 (등록: 13:00 ~ 14:00)</p><p><strong>&nbsp;&nbsp;다.&nbsp;장소</strong>:&nbsp;고려대학교 서울캠퍼스 내 인촌기념관 강당</p><p>&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;주차 지원 불가,&nbsp;가급적 대중교통 이용 요망</p><p><strong>&nbsp;&nbsp;라.&nbsp;대상</strong>:&nbsp;고&nbsp;1·2학년 학생·학부모·교사&nbsp;1,000명(사전 신청자에 한함)</p><p><strong>&nbsp;&nbsp;마.&nbsp;신청 기간</strong>: 5. 29.(월) 9:00 ~ 6. 2.(금) 17:00, 5일간</p><p><strong>&nbsp;&nbsp;바.&nbsp;신청 방법 및 대상자 선정</strong>:&nbsp;전자설문 응답 선착순&nbsp;1,000명</p><p><strong>&nbsp;&nbsp;사.&nbsp;진행순서</strong></p><p class="ql-align-center"><strong>순서</strong></p><p class="ql-align-center"><strong>시간</strong></p><p class="ql-align-center"><strong>내용</strong></p><p class="ql-align-center">등록</p><p class="ql-align-center">13:00 ~ 14:00</p><p class="ql-align-center">등록</p><p class="ql-align-center">개회</p><p class="ql-align-center">14:00 ~ 14:10</p><p class="ql-align-center">조희연 교육감 격려사</p><p class="ql-align-center">강의1</p><p class="ql-align-center">14:10 ~ 15:00</p><p class="ql-align-center">미래사회 변화에 대응하는 진로·진학 설계</p><p class="ql-align-center">강의2</p><p class="ql-align-center">15:00 ~ 15:50</p><p class="ql-align-center">교육과정의 이해와 진로 연계 과목 선택</p><p class="ql-align-center">강의3</p><p class="ql-align-center">16:00 ~ 16:50</p><p class="ql-align-center">2025, 2026&nbsp;대입 전형의 이해와 대비</p><p class="ql-align-center">폐회</p><p class="ql-align-center">16:50 ~ 17:00</p><p class="ql-align-center">만족도 조사 및 폐회</p><p class="ql-align-right">&nbsp;</p><p><strong>2.&nbsp;기타</strong></p><p><strong>&nbsp;&nbsp;가.&nbsp;설명회 영상 다시보기</strong>:&nbsp;유튜브 서울교육 쌤&nbsp;TV&nbsp;탑재(6. 16.&nbsp;이후)</p><p><strong>&nbsp;&nbsp;나.&nbsp;고</strong>&nbsp;<strong>1·2&nbsp