	(33, '2023-05-31 03:40:44.170353', '2023-09-11 03:40:44.170353', '<p class="ql-align-center"><strong>2023 온라인 코딩파티 시즌1 행사 참가 안내</strong></p><p class="ql-align-justify"><br></p><p class="ql-align-justify">1. 2023&nbsp;온라인 코딩파티 시즌1&nbsp;행사를 다음과 같이 개최한다 하니,&nbsp;관심있는 학생들은 참여하여 주시기 바랍니다.</p><p class="ql-align-justify">&nbsp;&nbsp;가.&nbsp;행사명: 2023&nbsp;온라인 코딩파티 시즌1</p><p class="ql-align-justify">&nbsp;&nbsp;나.&nbsp;목적: SW-AI에 관심 있는 누구나 온라인으로 쉽고 재미있게 학습할 수 있도록 다양한 온라인 소프트웨어·인공지능교육 체험 콘텐츠 및 기회 제공</p><p class="ql-align-justify"><strong>&nbsp;&nbsp;다.&nbsp;행사기간: 2023. 6. 12.(월) ~ 7. 23.(일),&nbsp;총&nbsp;6주간</strong></p><p class="ql-align-justify">&nbsp;&nbsp;라.&nbsp;참가대상:&nbsp;초·중·고&nbsp;SW-AI교육에 관심 있는 사람은 누구나(참가비 무료)</p><p class="ql-align-justify"><strong>&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;2023.&nbsp;인공지능(AI)교육 선도학교에서는 적극 참여 권장</strong></p><p class="ql-align-justify">&nbsp;&nbsp;마.&nbsp;참가방법: SW중심사회포털(www.software.kr)&nbsp;내 온라인 코딩파티 접속</p><p class="ql-align-justify">&nbsp;&nbsp;바.&nbsp;주최/주관:&nbsp;과학기술정보통신부,&nbsp;교육부&nbsp;/&nbsp;한국과학창의재단</p><p class="ql-align-justify">&nbsp;&nbsp;사.&nbsp;후원:&nbsp;네이버 커넥트재단</p><p class="ql-align-justify">&nbsp;&nbsp;아.&nbsp;참여기관:&nbsp;㈜로지브라더스,&nbsp;㈜마로마브,&nbsp;㈜브랜치앤바운드,&nbsp;㈜엘리스그룹,&nbsp;코드닷오알지(Code.org),&nbsp;㈜키워드랩,&nbsp;하이코두,&nbsp;한국교육방송공사(EBS) (총&nbsp;8개)</p><p class="ql-align-justify">&nbsp;&nbsp;자.&nbsp;운영 프로그램:&nbsp;블록코딩,&nbsp;텍스트코딩,&nbsp;컴퓨팅사고력,&nbsp;인공지능,&nbsp;디지털 리터러시 등</p><p><br></p>', 0, 0, '2023 온라인 코딩파티 시즌1 행사 참가 안내', 3),
	(34, '2023-06-01 03:41:04.059668', '2023-09-11 03:41:05.227801', '<p class="ql-align-justify">한국도박문제예방치유원은 늘어나는 청소년 도박문제를 대응하기 위해 도박문제 예방에서 치유까지 원스톱으로 서비스를 받을 수 있는 청소년 도박&nbsp;SOS사업을 운영하고 있다고 합니다.</p><p class="ql-align-justify"><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=ab3a2583988f6a13bf94c397de1add97/img_70b9v4d77=66vb9=49vbd=8dvc4=02dev7246v2032_v2198.png?837^1176" alt="포스터"></p><p><br></p>', 1, 0, '청소년 도박 SOS사업 안내', 3),
	(35, '2023-06-01 03:41:28.093014', '2023-09-11 03:41:28.093014', '<p class="ql-align-justify">건국대학교에서는 논술전형을 준비하는 수험생에게 도움을 주고자 아래와 같이 온라인 모의논술을 시행한다고 합니다.&nbsp;논술 전형을 준비하는 학생들은 신청하기 바랍니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">가.&nbsp;행사명: 2023년&nbsp;KU모의논술</p><p class="ql-align-justify">나.&nbsp;시행기간: 2023. 5. 31.(수) 10:00 ~ 6. 18.(일) 18:00</p><p class="ql-align-justify">다.&nbsp;응시방법</p><p class="ql-align-justify">1)&nbsp;본교 입학처 홈페이지 접속(링크: https://enter.konkuk.ac.kr)</p><p class="ql-align-justify">2)&nbsp;회원가입 및 응시:&nbsp;상세 방법은 붙임 문서 참조</p><p class="ql-align-justify">라.&nbsp;비고사항</p><p class="ql-align-justify">1)&nbsp;올해 출제경향을 미리 확인할 수 있도록&nbsp;<u>논술고사 준비생들은 모의논술 응시 권장</u></p><p class="ql-align-justify">2)&nbsp;개별 답안 채점은 진행하지 않음.</p><p class="ql-align-justify">3)&nbsp;답안을 정상적으로 작성·제출 완료한 응시자에게는&nbsp;KU논술가이드북을 개별 우송할 예정</p><p>&nbsp;</p>', 0, 0, '2023년 KU모의논술 실시 안내', 3),
	(36, '2023-06-07 03:41:49.871194', '2023-09-11 03:41:49.871194', '<p>국립 청소년 인터넷 드림마을은 여성가족부(한국청소년상담복지개발원)&nbsp;산하기관으로 청소년의 인터넷 및 스마트폰 과의존 해소를 위한 치유전문기관입니다.&nbsp;온라인 도박 치유캠프 참가 청소년을 모집한다고 합니다.</p><p>위와 관련하여 치유가 필요한 경우에는 신청하길 바랍니다.</p><p>&nbsp;</p><p>&nbsp;&nbsp;가.&nbsp;모집대상&nbsp;:&nbsp;온라인 도박 문제를 겪고 있는 만13세~18세 남자 청소년</p><p>&nbsp;&nbsp;나.&nbsp;캠프일정</p><p>&nbsp;&nbsp;다.&nbsp;참가비&nbsp;:&nbsp;참가비는 무료이나 자부담 원칙에 의해 식비 중 일부 부담(취약계층 청소년은 전액 면제)</p><p>&nbsp;&nbsp;라.&nbsp;접수방법</p><p>&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;온라인 신청&nbsp;:&nbsp;드림마을 홈페이지&nbsp;http://nyit.or.kr</p><p>&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;오프라인 신청&nbsp;:&nbsp;드림마을 홈페이지 관련서식 참조</p><p>&nbsp;&nbsp;마.&nbsp;문의&nbsp;:&nbsp;국립청소년인터넷드림마을 사업관리부(063-323-2646, 2285, 2282)</p><p><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=12af242a7279dd987a796b614efd9be9/img_c4fbvb7ee=c9v25=4ev3e=8avea=ea91v8e4avb7ac_v5757.jpg?2544^3573" alt="국립청소년인터넷드림마을 사업관리부_온라인 도박 치유캠프 안내문"></p><p>&nbsp;</p><p>&nbsp;</p>', 0, 0, '온라인 도박 치유 캠프 참가 청소년 모집', 3),
	(37, '2023-06-07 03:42:09.452753', '2023-09-11 08:18:11.752846', '<p class="ql-align-justify">서울시립대학교에서는&nbsp;2024학년도 수시모집 논술전형을 준비하는 수험생에게 논술고사 사전 경험 기회를 제공하고자 다음과 같이 모의 논술고사를 시행합니다. 2024학년도 대학입시에서 논술 전형에 관심있는 학생들은 신청하기 바랍니다.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify">&nbsp;&nbsp;가.&nbsp;모의 논술고사 신청</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;신청기간:<strong>2023. 6. 7.(수) 10:00 ~ 6. 20.(화) 17:00</strong></p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;신청방법:&nbsp;서울시립대학교 입학처 홈페이지(<a href="http://https//admission.uos.ac.kr" rel="noopener noreferrer" target="_blank" style="color: inherit;"><u>https://admission.uos.ac.kr</u></a>)&nbsp;공지사항 확인 후 온라인 신청</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;고교별 신청 시 담당교사&nbsp;1인이 신청</p><p class="ql-align-justify">&nbsp;&nbsp;다.&nbsp;모의 논술고사 개요</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;고사방법</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;▸&nbsp;신청자 이메일로 문제지,&nbsp;답안지 양식,&nbsp;해설지 등 송부(6. 23.(금)&nbsp;예정)</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;▸&nbsp;기간 중 신청자별 자체 시험 실시</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;별도 채점 또는 첨삭을 제공하지 않음</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;▸&nbsp;고교 담당교사 및 수험생별 설문 제출(온라인)</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;관련문의:&nbsp;서울시립대학교 입학처(02-6490-6180~1)</p><p>&nbsp;</p>', 1, 0, '2024대학 입힉 서울시립대학교 수시모집 모의 논술실시', 3),
	(38, '2023-06-07 03:42:29.814846', '2023-09-11 03:42:29.814846', '<p class="ql-align-justify">매일신문사와 계명대학교가 주최하고 경상북도가 후원하는&nbsp;\'제3회 사투리&nbsp;UCC&nbsp;백일장\'은 대구경북 사투리를 보존하고 그 가치를 재발견하기 위해 개최하는 의미있는 행사입니다.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;&nbsp;가.&nbsp;행사내용&nbsp;:&nbsp;대구경북 사투리로 꾸며진&nbsp;UCC&nbsp;공모(30초 이상,&nbsp;최대&nbsp;5분 이내/주제 제한 없음)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;예시&gt;&nbsp;고마운(그리운)&nbsp;사람에게 보내는 사투리 영상편지 또는 메시지</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;좋아하는 노래를 사투리로 바꾸어 부른 영상</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;좋아하는 시를 사투리로 바꾸어 낭독한 영상</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;사투리와 함께하는 일상생활 영상 등</p><p>&nbsp;&nbsp;나.&nbsp;행사기간&nbsp;: ~8월(접수마감&nbsp;: 6월&nbsp;18일(일))</p><p>&nbsp;&nbsp;다.&nbsp;협조사항&nbsp;:&nbsp;대구시 중고등학교 행사안내 공문게시 및 참가독려</p><p><br></p><p><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=0dc47079effaacec681413983fb3c2aa/img_cd51v140a=e9v14=4fvc1=a8v4c=32a8v4c81v1659_v1979.jpg?2186^981" alt="매일신문사_홍보물 시안"></p>', 0, 0, '제3회 사투리 UCC 백일장 안내', 3),
	(39, '2023-06-07 03:45:01.486122', '2023-09-11 03:45:01.486122', '<p>https://cg.dge.hs.kr/cgh/na/ntt/selectNttInfo.do?mi=10069416&amp;bbsId=10069416&amp;nttSn=40146441</p><p><br></p><p>학교 홈페이지 참고바랍니다.</p>', 0, 0, '2023학년도 기말고사 시간표 안내(변경) (2023. 6. 29.(목) ~ 2023. 7.4(화))', 3),
	(40, '2023-06-12 03:45:24.069955', '2023-09-11 03:45:24.069955', '<p>단국대학교 2024학년도 모의논술고사를 다음과 같이 시행한다고 합니다. 응시를 희망하는 학생은 신청을 해 보세요.</p><p>&nbsp;</p><p>1. 시행방법 : 고교별 자체 시행</p><p>&nbsp;</p><p>2. 세부일정 구분 일정 비고 신청기간 ▹ 2023. 6. 19(월) 10:00 ~ 20(화) 17:00 [2일간]&nbsp;</p><p>▸고교별 선착순 접수&nbsp;</p><p>▸총 15,000부 내외 제공 (고교별 인문/자연계열 각 50부 이내)&nbsp;</p><p>▹발송기간&nbsp;2023. 7. 10(월)&nbsp;</p><p>▸발송자료 : 문제지, 답안지, 가이드답안&nbsp;</p><p>▸홈페이지 공개 ▹ 2023. 7. 21(금),&nbsp;문제, 가이드답안 및 강평영상 홈페이지 게재</p><p><br></p><p>※ 고교 교사만 접수 가능하며, 수험생 및 학부모 단독 접수는 불가함&nbsp;</p><p>※ 대학 사정에 따라 일정이 변경될 수 있으며, 변경 시 입학안내 홈페이지에 공지함&nbsp;</p><p>3. 기타사항</p><p>가. 모의논술고사 시행 및 채점은 고교별로 자체 시행합니다. (별도의 채점 서비스를 제공하지 않음)&nbsp;</p><p>나. 개별적으로 모의논술고사 응시를 희망하는 경우 추후 입학안내 홈페이지를 통해 공개 되는 모의논술고사 자료 및 강평영상을 활용하시기 바랍니다.&nbsp;</p><p>다. 신청방법 관련 자세한 사항은 아래의 붙임자료를 참고하시기 바랍니다.&nbsp;</p><p>※ 문의처 : 죽전캠퍼스 입학1팀(031-8005-2550~3</p>', 0, 0, '단국대학교 2024학년도 모의논술고사 실시 안내', 3),
	(41, '2023-06-13 03:45:45.547300', '2023-09-11 03:45:45.547300', '<p class="ql-align-center">2023년도 여름방학 중 급식지원 신청안내서</p><p><strong>&nbsp;</strong></p><p><strong>□&nbsp;급식지원 신청방법</strong></p><p>♣&nbsp;2023년 여름방학 아동급식지원이 필요한 경우에는 다음 방법으로 아동급식을 신청하여 주시기 바랍니다.</p><p><strong>&nbsp;&nbsp;①&nbsp;방문 신청&nbsp;:&nbsp;관할 행정복지센터 방문신청</strong></p><p>&nbsp;&nbsp;②&nbsp;온라인신청&nbsp;:&nbsp;복지로(www.bokjiro.go.kr)에서&nbsp;신청</p><p>&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;복지로&nbsp;→&nbsp;온라인신청&nbsp;→&nbsp;복지서비스신청&nbsp;→&nbsp;복지서비스안내&nbsp;→&nbsp;아동급식 신청</p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;실 거주지와 다를 경우 관할 행정복지센터에 직접 신청할 것.</strong></p><p><br></p><p><strong style="color: rgb(255, 156, 35);">* 자세한 내용은 첨부 파일을 꼭 확인해 주시기 바랍니다.</strong></p><p>&nbsp;</p><p>https://cg.dge.hs.kr/cgh/na/ntt/selectNttInfo.do?mi=10069416&amp;bbsId=10069416&amp;nttSn=40151959</p>', 0, 0, '2023년도 여름방학 중 급식지원 신청안내서', 3),
	(42, '2023-06-15 03:46:10.070862', '2023-09-11 03:46:10.070862', '<p>[경희대학교] 2024학년도 온라인 모의논술고사</p><p>1) 고사기간 : 2023. 6. 22.(목) 10:00 ~ 25.(일) 17:00(기간 중 수험생이 자유롭게 응시)</p><p>2) 출제문항 : 인문·체육계, 사회계, 자연계(수학), 의·약학계(수학, 과학)</p><p>3) 응시대상 : 수험생 모두 가능(인원제한 없음)</p><p>4) 응 시 료 : 없음</p><p>5) 결과제공 : 개별점수 및 논술특강 제공[2023. 8. 4.(금) 입학처 홈페이지에 공지 예정]</p><p>나. 응시방법 : 경희대학교 입학처 홈페이지(iphak.khu.ac.kr)에 \'온라인 모의논술 수험생 가이드\' 확인[2023. 6. 22.(목) 공지 예정</p><p><br></p><p><a href="http://iphak.khu.ac.kr/detail.do?menuurl=RnNfVbLHUGrJz9kJgEyRDQ%3D%3D&amp;board_seq=8548&amp;pageNo=1&amp;categoryid=&amp;userpwd=" rel="noopener noreferrer" target="_blank" style="color: inherit;"><strong>경희대학교 모의 논술 실시 안내</strong></a><strong>&nbsp;&lt;- 누르세요.</strong></p>', 0, 0, '[경희대학교] 2024학년도 온라인 모의논술고사 실시 안내', 3),
	(43, '2023-06-27 03:46:53.265793', '2023-09-11 08:17:53.865583', '<p class="ql-align-justify">국민대학교&nbsp;SW중심대학 사업단 및 소프트웨어융합대학에서 우리나라 소프트웨어 분야 저변 확대와 산업 발전을 위해&nbsp;"제8회 국민대학교 알고리즘 대회"를 개최합니다.&nbsp;본 대회를 통해 창의적인 소프트웨어 개발 역량을 보유한 인재를 발굴하여 미래&nbsp;IT강국의 초석으로 육성하고자 하오니, 학생들의 참여바랍니다.</p><p class="ql-align-justify">&nbsp;&nbsp;가.&nbsp;대회명칭:&nbsp;제8회 국민대학교 알고리즘 대회</p><p class="ql-align-justify">&nbsp;&nbsp;나.&nbsp;참가대상:&nbsp;전국 고등학교 재학생 및 졸업생 또는 법령에 의하여 이와 동등</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;이상의 학력이 있다고 인정된 자</p><p class="ql-align-justify">다.&nbsp;대회일정: 2023.08.04.(금) 14:00 ~ 16:00</p><p class="ql-align-justify">&nbsp;&nbsp;라.&nbsp;접수기간: 2023.07.10.(월) 15:00 ~ 2023.07.12.(수) 15:00(선착순&nbsp;350명)</p><p class="ql-align-justify">&nbsp;&nbsp;마.&nbsp;신청방법:&nbsp;인터넷 접수(www.uwayapply.com)</p><p class="ql-align-justify">&nbsp;&nbsp;바.&nbsp;대회 홈페이지: softwarecontest.kookmin.ac.kr</p><p class="ql-align-justify">&nbsp;&nbsp;사.&nbsp;문의처:&nbsp;국민대학교&nbsp;SW중심대학 사업단 및 소프트웨어융합대학</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(이메일&nbsp;swcontest@kookmin.ac.kr /&nbsp;유선번호&nbsp;02-910-5986~5988, 5282~3)</p><p class="ql-align-justify">3.&nbsp;제8회 국민대학교 알고리즘 대회 참여 학생 및 학부모님을 대상으로&nbsp;"입시 설명회"를 개최하고자 하오니,&nbsp;학생 및 학부모님이 참여할 수 있도록 안내를 요청 드립니다.</p><p class="ql-align-justify">&nbsp;&nbsp;가.&nbsp;일시 및 장소</p><p class="ql-align-center"><strong>참석대상</strong></p><p class="ql-align-center"><strong>일시</strong></p><p class="ql-align-center"><strong>장소</strong></p><p class="ql-align-center">학부모</p><p class="ql-align-center">2023.08.04.(금) 14:00~16:00</p><p class="ql-align-center">국민대학교 본부관&nbsp;1층</p><p class="ql-align-center">학술회의장</p><p class="ql-align-center">학생</p><p class="ql-align-center">2023.08.04.(금) 16:30~18:00</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;나.&nbsp;내용</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;1)&nbsp;소프트웨어학부 등 이공계 중심 입시 설명회</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;2)&nbsp;소프트웨어 특기자 전형 등 수시 전형 전반에 대한 질의 및 응답</p><p class="ql-align-justify">&nbsp;&nbsp;다.&nbsp;문의처:&nbsp;국민대학교 입학처(02-910-5703~5720)</p><p><br></p>', 1, 0, '제8회 국민대학교 알고리즘 대회 참가 안내', 3),
	(44, '2023-07-03 03:47:24.565435', '2023-09-11 03:47:24.565435', '<p><strong style="color: rgb(102, 102, 102);">2024학년도 대학수학능력시험 시행세부계획 공고문 및 보도자료</strong></p><p><br></p><p>https://cg.dge.hs.kr/cgh/na/ntt/selectNttInfo.do?mi=10069416&amp;bbsId=10069416&amp;nttSn=40176035</p><p><br></p><p><strong style="color: rgb(102, 102, 102);">* 자세한 내용은 홈페이지 내 첨부된 파일을 참고하시기 바랍니다.</strong></p><p><strong style="color: rgb(102, 102, 102);">문의 사항은; 053-235-4912</strong></p>', 0, 0, '2024학년도 대학수학능력시험 시행세부계획 공고문 및 보도자료', 3),
	(45, '2023-07-05 03:47:48.297458', '2023-09-11 03:47:48.297458', '<p>KAIST SW교육센터에서는&nbsp;SW가치확산의 일환으로 소프트웨어 진로에 관심있는 고등학생을 위해&nbsp;\'2023&nbsp;전국 고등학생 대상&nbsp;SW전공 진로탐색 캠프\'를 운영합니다.&nbsp;관심 있는 학생들은 신청하세요</p><p>&nbsp;</p><p class="ql-align-center">=&nbsp;아 래&nbsp;=</p><p class="ql-align-center">&nbsp;</p><p>가.&nbsp;목 적</p><p>1)&nbsp;소프트웨어 저변확대 및 인식 제고</p><p>2)&nbsp;소프트웨어 전문가 강연 및 실습을 통한&nbsp;SW&nbsp;전공·진로 선택에 기여</p><p>나.&nbsp;대 상&nbsp;:&nbsp;전국 고등학생&nbsp;/&nbsp;총&nbsp;100명</p><p>다.&nbsp;모집기간 및 방법</p><p>1)&nbsp;기 간&nbsp;: 2023. 7. 3(월) ~ 2022. 7. 9(일) 18시까지</p><p>2)&nbsp;방 법&nbsp;:&nbsp;온라인 신청(https://forms.gle/fkVeeHwJD4dJdD267),&nbsp;선착순 접수</p><p>3)&nbsp;교육비&nbsp;:&nbsp;무료지원</p><p><strong>※&nbsp;모집 기간 중 사전 신청을 하신 분께&nbsp;Zoom&nbsp;링크를 발송해 드립니다.</strong></p><p>라.&nbsp;교육기간 및 장소</p><p>1)&nbsp;기 간&nbsp;: 2023. 7. 15(토) 13:00~17:00(총&nbsp;4시간)</p><p>2)&nbsp;장 소&nbsp;:&nbsp;비대면 온라인 진행</p><p>마.&nbsp;주요내용</p><p>1)&nbsp;산·학&nbsp;SW전문가 특강</p><p>2) KAIST SW전공생 진로탐색 특강</p><p>3) SW&nbsp;응용실습</p><p>바.&nbsp;주최·주관</p><p>1)&nbsp;주 최&nbsp;:&nbsp;과학기술정보통신부,&nbsp;정보통신기획평가원(IITP)</p><p>2)&nbsp;주 관&nbsp;: KAIST SW교육센터</p><p>사.&nbsp;문의처&nbsp;: KAIST SW교육센터 운영팀(042-350-6023, akdl23@kaist.ac.kr)</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=0d5b1fa72de4df9cc3cbb91062796814/img_1e77vffdb=45v24=42ve5=adva5=75c7v0e40v9e85_v5541.jpg?891^1260" alt="한국과학기술원(kaist) SW교육센터 운영팀_붙임2. 포스터"></p><p><br></p>', 0, 0, '2023 전국 고등학생 대상 SW전공 진로탐색 캠프 안내', 3),
	(46, '2023-07-05 03:48:29.307390', '2023-09-11 03:48:29.307390', '<p>알려드립니다.&nbsp;</p><p>&nbsp;</p><p>불안정한 나이스 시스템 관계로 2학년, 3학년 정답은 추후에 공개하겠습니다.&nbsp;</p><p><br></p><p>https://cg.dge.hs.kr/cgh/na/ntt/selectNttInfo.do?mi=10069416&amp;bbsId=10069416&amp;nttSn=40180768</p><p><br></p><p>학교 홈페이지 내 첨부파일 확인바람</p>', 0, 0, '2023학년도 1학기 기말고사 정답 안내- 1학년', 3),
