	(48, '2023-07-06 03:49:05.481499', '2023-09-11 06:02:23.962696', '<p><span style="color: rgb(51, 51, 51);"><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=d960c8679b57e67908e6b9cd132f998d/img_25bbvce7f=96v11=44v57=a9v21=c1a9v3790vf036_v6357.png?788^1106" alt="DGB독도 골든벨"></span></p>', 1, 0, '제13회 DGB 독도사랑 골든벨 개최 안내', 3),
	(49, '2023-07-17 03:49:31.171381', '2023-09-11 03:49:31.171381', '<p>2학기 학사일정이 변경됨에 따라 학사일정표를 재 안내 드립니다.</p><p><br></p><p>https://cg.dge.hs.kr/cgh/na/ntt/selectNttInfo.do?mi=10069416&amp;bbsId=10069416&amp;nttSn=40193229</p><p>&nbsp;</p><p>- 청구고 교무</p><p><br></p><p><br></p>', 0, 0, '2023학년도 학사일정 변경사항 안내', 3),
	(50, '2023-07-18 03:49:53.718813', '2023-09-11 03:49:53.718813', '<p>아래 일정을 참고해 주시기 바랍니다.</p><p>* 학교 홈페이지는 정상적으로 운영이 됩니다.</p><p>&nbsp;</p><p>&nbsp;</p><p class="ql-align-center">일 시</p><p class="ql-align-center"><strong>중학교</strong>(임시교사,공사현장)</p><p class="ql-align-center"><strong>고등학교</strong></p><p class="ql-align-center">7. 20.(목)</p><p class="ql-align-center">오전</p><p class="ql-align-center">오전&nbsp;7시부터 전체 정전</p><p class="ql-align-center">7. 20(목)&nbsp;오후</p><p>중학교 전체 복구 및 정상 전력공급</p><p>본관&nbsp;1층에만 제한적으로</p><p>비상전력 공급</p><p>&nbsp;&nbsp;&nbsp;-&nbsp;냉방 불가</p><p>&nbsp;&nbsp;-&nbsp;전화 가능</p><p>&nbsp;&nbsp;&nbsp;-&nbsp;인터넷 가능</p><p class="ql-align-center">7. 21.(금)</p><p class="ql-align-center">〃</p><p class="ql-align-center">7. 22.(토)</p><p class="ql-align-center">〃</p><p class="ql-align-center">7. 23.(일)</p><p class="ql-align-center">〃</p><p class="ql-align-center">7. 24.(월)</p><p class="ql-align-center">〃</p><p>오전:&nbsp;사용 전 검사</p><p><br></p><p>오후:&nbsp;전체 정상 전력공급</p><p>&nbsp;</p>', 0, 0, '임시 단전으로 인한 학교 업무 안내', 3),
	(51, '2023-07-31 03:50:12.710206', '2023-09-11 08:17:57.849608', '<p class="ql-align-justify">최근 공무원 및 공공기관 재직자를 대상으로 텔레그램 메신저 등을 통한 피싱시도 및 피해가 발생하고 있습니다.</p><p class="ql-align-justify">이와 관련하여,&nbsp;텔레그램을 사칭한 피싱 사례 및 예방법을 붙임으로 안내드리오니 개인정보 유출 및 악성앱 감염 등의 피해를 예방할 수 있도록 하여 주시기 바랍니다.</p><p class="ql-align-justify">▣&nbsp;사례</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">텔레그램을 사칭하여 불법 로그인 탐지 안내 또는 보안 업데이트 안내 등의 내용으로 피싱사이트로 접속하게 한 후 개인정보를 입력을 유도</p><p class="ql-align-justify">4.&nbsp;아울러,&nbsp;개인 심리를 이용하거나 지속적인 시도를 통해 해킹 메일을 발송하는 방법으로 개인정보 유출,&nbsp;랜섬웨어 감염 등이 발생할 수 있으므로 의심스러운 메일에 유의하시기 바랍니다.</p><p>&nbsp;</p>', 4, 0, '텔레그램 메신저 피싱 사례 및 예방법', 3),
	(52, '2023-08-03 03:50:32.330259', '2023-09-11 08:17:47.359298', '<p>나이스 플러스(학생)&nbsp;및 학부모서비스 가입, 이용 안내입니다.</p><p>자세한 내용은 첨부된 파일을 확인하시기 바랍니다.</p><p><br></p><p>* 디지털 원패스 가입 안내:&nbsp;<a href="https://www.onepass.go.kr/" rel="noopener noreferrer" target="_blank" style="color: inherit;">https://www.onepass.go.kr/</a></p><p>* 나이스 플러스 가입 사이트 주소 :&nbsp;<a href="https://neisplus.kr/" rel="noopener noreferrer" target="_blank" style="color: inherit;">https://neisplus.kr</a></p><p>* 교육디지털 원패스 사이트 주소:&nbsp;<a href="https://edupass.neisplus.kr/nxuiPtl/index.html" rel="noopener noreferrer" target="_blank" style="color: inherit;">https://edupass.neisplus.kr/nxuiPtl/index.html</a></p><p>* 가입이 안되는 학생은 담임 선생님에게 이야기를 해 주기 바랍니다.</p><p>* 모바일 앱 다운받기</p><p>&nbsp;&nbsp;◦&nbsp;(안드로이드)&nbsp;Play스토어,&nbsp;원스토어,&nbsp;(아이폰)&nbsp;앱스토어에서&nbsp;‘<span style="color: rgb(32, 58, 123);">나이스플러스</span>‘, ‘<span style="color: rgb(32, 58, 123);">교육디지털원패스</span>’를 검색 후 설치</p>', 3, 0, '나이스 플러스(학생) 및 학부모서비스 안내', 3),
	(53, '2023-08-09 03:51:46.744261', '2023-09-11 08:17:55.957495', '<p class="ql-align-justify">학생 및 학부모님께&nbsp;</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">제6호 태풍&nbsp;\'카눈\'&nbsp;북상에 따라&nbsp;2023. 8. 10.(목) 1일간 휴업일로 안내드립니다.</p><p class="ql-align-justify">&nbsp;</p><p>&nbsp;</p>', 5, 0, '제6호 태풍 \'카눈\' 북상에 따른 휴업일 안내(2023. 8. 10.(목))', 3),
	(54, '2023-08-11 03:52:01.036026', '2023-09-12 07:09:26.175624', '<p class="ql-align-justify">학생 및 학부모님께&nbsp;</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">2023학년도 학사일정에 따라&nbsp;2023. 8. 14.(월,&nbsp;1일간)은 청구고등학교 재량휴업일임을&nbsp;안내드립니다.</p><p class="ql-align-justify">&nbsp;</p><p><br></p>', 3, 0, '청구고등학교 재량휴업일 안내(8.14)', 3),
	(55, '2023-08-18 03:52:19.995294', '2023-09-12 06:51:17.286371', '<p class="ql-align-center"><strong>2024학년도</strong>&nbsp;<strong>대학수학능력시험</strong>&nbsp;<strong>원서 접수</strong>&nbsp;<strong>안내</strong></p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-justify">&nbsp;&nbsp;▶&nbsp;<strong>접수 기간</strong>&nbsp;(변경 기간 동일)&nbsp;&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="color: rgb(255, 0, 0);">-&nbsp;</span><strong style="color: rgb(255, 0, 0);">2023.8.24.(목)&nbsp;~&nbsp;9.8.(금), 09:00~17:00</strong>&nbsp;(토요일 및 공휴일 제외,&nbsp;점심시간12:00~12:30)</p><p class="ql-align-justify"><strong>&nbsp;&nbsp;&nbsp;&nbsp;</strong></p><p class="ql-align-justify"><span style="color: rgb(255, 0, 0);">&nbsp;</span>&nbsp;▶&nbsp;<strong>제출 서류</strong></p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.&nbsp;신분증&nbsp;(주민등록증,&nbsp;유효기간 내 주민등록증 발급신청확인서,&nbsp;운전면허증,&nbsp;기간만료 전 주민등록번호가 표시된 여권)</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.&nbsp;응시수수료&nbsp;<strong style="color: rgb(255, 0, 0);">(현금 납부)</strong></p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.&nbsp;여권용 규격 사진&nbsp;2매&nbsp;(응시원서와 수험표 부착용)</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;◦&nbsp;원서접수일 기준&nbsp;6개월 이내(2023.2.29.이후)에 촬영된 천연색 상반신&nbsp;정면 여권용 규격 사진</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(가로3.5㎝×세로4.5㎝)으로,&nbsp;머리의 길이(정수리부터 턱까지)가&nbsp;3.2㎝~3.6㎝이어야 함.</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;◦&nbsp;머리카락,&nbsp;안경테 등으로 눈을 가리거나 모자 등으로 머리를 가리면 안 됨.</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;◦&nbsp;디지털 사진의 경우 관련&nbsp;S/W를 통한 원판 변형을 금지함.</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;◦&nbsp;배경은 균일한 흰색이어야 하고 테두리가 없어야 함.</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;※&nbsp;자세한 사항은 대구시교육청/교육청안내/공개자료실/2024&nbsp;수능 원서접수 관계자 회의자료 서식</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;▶&nbsp;<strong>응시수수료</strong></p><p class="ql-align-center">응시 영역 수</p><p class="ql-align-center">4개 영역 이하</p><p class="ql-align-center">5개 영역</p><p class="ql-align-center">6개 영역</p><p class="ql-align-center">응시수수료(원)</p><p class="ql-align-center">37,000</p><p class="ql-align-center">42,000</p><p class="ql-align-center">47,000</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;▶&nbsp;<strong>응시수수료 면제</strong></p><p class="ql-align-justify"><span style="color: rgb(255, 0, 0);">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>1.&nbsp;대상자&nbsp;:&nbsp;원서접수일 현재 수험생이&nbsp;①국민기초생활보장법 제2조에 의한 국민기초생활수급자(생계,&nbsp;의료,&nbsp;주거,&nbsp;교육급여 및&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;생계급여조건부,&nbsp;보장시설 수급자 중&nbsp;1개&nbsp;이상 해당하는 자),&nbsp;②법정차상위계층(장애인연금,&nbsp;장애수당,&nbsp;자활근로,&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;차상위본인부담경감,&nbsp;차상위계층 확인 대상자 중&nbsp;1개 이상 해당하는 자),&nbsp;③한부모가족지원법 제5조에 의한&nbsp;한부모&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;가족보호대상자 중 하나에 해당하는 자</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.&nbsp;신청 절차&nbsp;:&nbsp;원서접수 시 증빙서류를 제출하고 응시수수료는 납부하지 않음.</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.&nbsp;제출 서류</p><p class="ql-align-center">구분</p><p class="ql-align-center">제출 서류</p><p class="ql-align-center">국민기초생활수급자</p><p>국민기초생활수급자 증명서</p><p class="ql-align-center">법정차상위계층</p><p>장애인연금 수급자 확인서</p><p>장애수당 수급자 확인서</p><p>자활근로자 확인서</p><p>차상위 본인부담경감 대상자 증명서</p><p>차상위계층 확인서</p><p class="ql-align-center">한부모가족지원대상자</p><p>한부모가족 증명서</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;*&nbsp;해당증명서는 접수시작일로부터 최근&nbsp;<strong>1개월 이내</strong>&nbsp;(2023.7.25.이후)&nbsp;발급분부터 유효</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;▶&nbsp;<strong>대리 접수</strong>&nbsp;<span style="color: rgb(255, 0, 0);">(첨부파일 접수자별 준비물 참고)</span></p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;*원칙:&nbsp;<strong>본인이 직접 접수하는 것을 원칙으로 하고 직접 접수의 예외 사례를&nbsp;엄격히 제한</strong>하고 있으며 대리&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;접수자는 응시자의 직계 가족에 한하여 허용함.</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(가족관계증명서,&nbsp;주민등록등본 등으로 응시자와의 관계 확인이 가능한 경우만 인정)</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;*대상:&nbsp;고교 졸업자(검정고시 합격자 등도 포함)&nbsp;중 장애인(시험편의제공대상자에 한함), 수형자,&nbsp;군 복무자,&nbsp;입원 중인&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;환자,&nbsp;원서접수일 기준 해외거주자(해외 여행자는&nbsp;해당되지 않음)로 제한하되,&nbsp;기타 불가피한 경우에는&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;교육감의 결정으로 허용</p><p class="ql-align-justify"><span style="color: rgb(255, 0, 0);">&nbsp;&nbsp;&nbsp;</span></p><p class="ql-align-justify">&nbsp;&nbsp;▶<span style="color: rgb(25, 101, 171);">&nbsp;</span><strong>대리 접수 시 필요 서류</strong></p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1.&nbsp;대리 접수 서약서&nbsp;(첨부파일&nbsp;서식 다운 받아서&nbsp;<span style="color: rgb(255, 0, 0);">지원자 본인 직접 작성</span>)</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2.&nbsp;지원자와 대리 접수자의 각 신분증 및 규격에 맞는 사진&nbsp;2매</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3.&nbsp;관련 증빙서류</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;-&nbsp;유효기간 내 장애인등록증(복지카드),&nbsp;&nbsp;수감확인서,&nbsp;&nbsp;군복무확인서,&nbsp;&nbsp;입원확인서,&nbsp;&nbsp;출입국 사실증명서,&nbsp;&nbsp;격리통지서 등</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;*&nbsp;대리접수에 한하여 출신 고교 또는 주민등록상 주소지 관한 시험지구에 접수를 하는 경우에는&nbsp;군복무확인서 대신&nbsp;</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;병적증명서도 허용</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4.&nbsp;대리 접수자와 지원자와의 관계 입증서류</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;①직계가족&nbsp;:&nbsp;주민등록등본(세대 분리의 경우 가족관계증명서가 필요,&nbsp;최근&nbsp;1개월 이내&nbsp;발급분부터 유효)</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;②관련공무원(수형자의 경우) :&nbsp;신분증 확인으로 대체가능</p><p class="ql-align-justify"><strong>&nbsp;</strong></p><p class="ql-align-justify"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></p><p class="ql-align-justify">&nbsp;&nbsp;☎&nbsp;문의처: 청구고&nbsp;행정실&nbsp;053)235-5001</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;대구시교육청 중등교육과&nbsp;053)231-0392, 0393</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;한국교육과정평가원&nbsp;043)931-0114</p><p><br></p>', 4, 0, '2024학년도 대학수학능력시험 응시원서 접수 안내', 3),
	(56, '2023-08-18 03:53:56.992393', '2023-09-12 07:46:24.112811', '<p>2023학년도 1학기 기말고사 성적입력 및 확정기간을 안내합니다.</p><p><br></p><p>해당 기간 동안 성적 변동이 있을 수 있으니 서비스 이용에 참고하시기 바랍니다.</p><p><br></p><p><br></p><p>1. 기말고사 성적입력기간: 2023. 08. 18.(금) ~ 2023 09. 01.(금)</p><p>2. 기말고사 성적확정기간: 2023. 09. 04.(월) 이후</p><p><br></p><p><br></p><p>※ 성적과 관련된 문의 및 이의사항은 담임선생님을 통해 확인하시기 바랍니다.</p>', 5, 0, '2023학년도 1학기 기말고사 성적입력 및 확정기간 안내(성적확정기간: 2023. 9. 4.(월) 이후)', 3),
	(57, '2023-08-23 03:54:22.443824', '2023-09-11 08:17:26.200065', '<p>독서교육종합지원시스템 가입 안내입니다.</p><p>&nbsp;</p><p>자세한 사항은 첨부된 파일을 참고 바랍니다.</p><p><br></p><p>https://cg.dge.hs.kr/cgh/na/ntt/selectNttInfo.do?mi=10069416&amp;bbsId=10069416&amp;nttSn=40212319</p>', 2, 0, '독서교육종합지원시스템 가입 안내', 3),
