	(59, '2023-09-06 03:55:23.562508', '2023-09-12 07:48:25.051499', '<p>2024학년도 대구광역시 동구 &lt;고입 박람회&gt; 개최</p><p>&nbsp;</p><p>일시 : 2023년 9월 16일(토) 13:00-17:00</p><p>장소 : 대구일마이스터고등학교 대강당 및 시청각실</p><p>주최 : 대구광역시 동구청, 대구광역시 동구 진로진학지원센터</p><p>&nbsp;</p><p>대상 : 고등학교 입학을 앞둔 중학생, 학부모, 교사</p><p>내용 : 특강(교육정책 변화에 따른 고교 선택), 관심 학교와 1:1 상담</p><p>&nbsp;</p><p>참가학교 : 청구고등학교, 강동고등학교, 대구동부고등학교, 영신고등학교, 정동고등학교, 대구공업고등학교, 대구관광고등학교, 달구벌고등학교, 조일고등학교, 대구일마이스터고등학교 (이상 10개교)</p><p>&nbsp;</p><p><img src="https://cg.dge.hs.kr/common/nttEditorImgView.do?imgKey=249516ef1af916df4bf0decc3162d3f1/img_aa21v0d1d=c9v6e=4dv61=a9v87=98ccv5a33v404a_v2637.jpg?1160^1644" alt="00"></p>', 14, 0, '2024 대구광역시 동구 <고입 박람회> 개최', 3),
	(60, '2023-09-07 03:55:47.763421', '2023-09-12 07:23:37.442939', '<p class="ql-align-center"><strong>수시모집 안내문</strong></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">안녕하십니까?</p><p class="ql-align-justify">2024학년도 대학입학전형 수시모집 원서접수가&nbsp;9.11.(월) ~ 9.15.(금)&nbsp;실시됨에 따라,&nbsp;수시모집전형에 대한 유의사항을 안내해드리오니 참고하시기 바랍니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong>1.</strong>&nbsp;<strong>대학의 원서접수기간을 확인하시고, 6회 지원가능 횟수에 유의하세요!</strong></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">◦&nbsp;각 대학은&nbsp;9.11.(월) ~ 9.15.(금)&nbsp;중&nbsp;3일 이상을 정하여 접수를 받기 때문에 대학마다 접수기간이 다릅니다.&nbsp;희망대학&nbsp;<u>수시모집요강의 원서접수 마감일(시간)을 반드시 확인</u>하세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">◦&nbsp;또한&nbsp;<u>원서접수가 완료되어 수험번호가 생성된 원서는 취소할 수 없으며</u>,&nbsp;<u>6회를&nbsp;초과하여 지원할 수 없습니다(교육대학 포함,&nbsp;산업대학,&nbsp;전문대학 제외).</u>&nbsp;원서접수를 완료하기 전에 희망전형,&nbsp;모집단위를&nbsp;꼼꼼히 확인하세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong>2.</strong>&nbsp;<strong>수시모집 합격자는 정시･추가모집에 지원할 수 없습니다!</strong></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">◦&nbsp;<u>2024학년도 수시모집에 합격한 자(교육대학,&nbsp;산업대학,&nbsp;전문대학 포함)는 등록&nbsp;여부와 관계없이&nbsp;2024학년도&nbsp;정시･추가모집에 지원할 수 없습니다.</u></p><p class="ql-align-justify">&nbsp;&nbsp;※&nbsp;최초·충원 합격자 모두 해당되며 등록할 의사가 없어도 정시·추가모집 지원 불가</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">◦&nbsp;수험생은&nbsp;<u>등록기간 내에&nbsp;1개 대학에만 최종 등록</u>하여야 하며,&nbsp;이중등록된&nbsp;경우 대입지원 위반자가 되어 합격사실이 취소될&nbsp;수 있습니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong>3.</strong>&nbsp;<strong>‘0’원 고지서도 은행에서 수납 확인을 받으셔야 합니다!</strong></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">◦&nbsp;수시모집 합격자는 등록 기간 내에&nbsp;‘등록(예치금 납부,&nbsp;문서등록 등)’을 하셔야 합니다.&nbsp;<u>등록금(예치금)&nbsp;면제 대상자</u>라도&nbsp;등록금(<u>예치금)&nbsp;고지서를 확인하시어&nbsp;등록금(예치금)을 납부</u>하셔야 합니다.&nbsp;대학에 따라 사전면제(‘0’원고지서)&nbsp;또는 사후환불(‘장학금’)&nbsp;제도를 운영하므로, ‘등록금(예치금)&nbsp;고지서의 금액’을&nbsp;반드시 확인하세요.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">◦&nbsp;<u>‘0’원 고지서는 은행을 방문하여 수납 확인</u>을 받아야&nbsp;‘등록 의사’를 표명한 것으로 봅니다.</p><p class="ql-align-justify">&nbsp;&nbsp;&nbsp;※&nbsp;최종 등록(등록금 납부)&nbsp;관련 내용은 반드시 대학별 공지를 확인하시기 바랍니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong>4.</strong>&nbsp;<strong>희망전형의 지원자격 요건을 반드시 확인하시기 바랍니다!</strong></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">◦&nbsp;대학은 전형별 지원자격 요건을 검증하기 위해 추가서류를 제출받고 있으며,&nbsp;<u>지원자격이 충족되지 않으면 합격취소(입학취소)</u>될 수 있습니다.</p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify"><strong>5.&nbsp;공통원서는 미리 작성하여 원서접수를 준비하시기 바랍니다!</strong></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">◦&nbsp;6.26.(월) 10시부터 표준 공통원서 접수서비스가 사전 오픈하여 미리 공통원서를 작성할 수 있으며,&nbsp;한 번 작성한 공통원서는 여러 대학에 활용할 수 있습니다.</p><p class="ql-align-justify">◦&nbsp;표준 공통원서 접수서비스는&nbsp;Windows OS를 기반으로&nbsp;Chrome&nbsp;또는&nbsp;MS Edge&nbsp;브라우저를 사용을 권장하고 있습니다.&nbsp;또한,&nbsp;공통원서를 수정하고 저장한&nbsp;경우 하단의 내보내기 버튼을 클릭해야 타 대행사에도 수정 내용이 적용된다는 점을 유의하여 주시기 바랍니다.</p><p class="ql-align-justify">◦&nbsp;원서접수 마감 시점에 사용자가 집중될 경우 많은 시간이 소요되는 등의 어려움이&nbsp;발생할 수 있으므로,&nbsp;미리 자신의 컴퓨터에서 원서접수 대행사에 접속하여&nbsp;통합회원 가입과 공통원서 작성에 문제가 없는지 미리 확인하고 준비할 것을 당부 드립니다.</p><p class="ql-align-justify"><strong>&nbsp;</strong></p><p class="ql-align-justify"><strong>6.&nbsp;아울러&nbsp;허위 원서접수뿐 아니라 모의지원 시스템 상 허수 지원도 민·형사상 책임을 질 수 있으니 유의하여 주시기 바랍니다!</strong></p><p class="ql-align-justify">&nbsp;</p><p class="ql-align-justify">□&nbsp;<u>희망대학의 모집요강을 반드시 확인</u>하시어 피해를 예방하시기 바랍니다!&nbsp;기타 대입 문의는&nbsp;<strong>대입상담센터(☎1600-1615)</strong>,&nbsp;<strong>대입정보포털(adiga.kr)</strong>로 연락주세요.</p><p>&nbsp;</p>', 7, 1, '대입 수시모집 사전 안내문(고3 및 학부모 안내 목적)', 3);
